import './Navbar.css';
import data from '../dataCenter';

function ItemBody() {
    const {categories,items,users, NavbarItem} = data;
    console.log(data);
  return (
    <div className="container">
      {
          NavbarItem.map(category => {
              return (<div className="navbarItem">
                  {category}
              </div>)
          })
      }
    </div>
  );
}

export default ItemBody;
